import React from 'react';
import p5 from 'p5';

const Sketch = (props) => {
  const Sketch = (p) => {
    p.setup = () => {
      p.createCanvas(400, 400);
    };

    p.draw = () => {
      p.background(220);
      p.ellipse(50, 50, 70, 70);
    };
  };

  return <p5.Wrapper sketch={Sketch} />;
};

export default Sketch;
